function App() {
 const ctx=useContext(DataContext)
 console.log(ctx.data.length);
  return (
    <React.Fragment>
      <section>
        <Searche/>
      </section>
      {ctx.data.length!==0 & <section><LoanTable /></section>}
      
    </React.Fragment>
  );
}

export default App;
